import React from 'react';

const CartButton = ({value}) => {
    const {cart} =value;
    return (
        <button className="mycartbtn"><Link to="/cart" ><i className="mycart fas fa-cart-plus"/>My Cart ( {cart.length} ) : $0</Link></button>
    );
};

export default CartButton;
